import React from "react";
import { NavLink } from "react-router-dom";

const Menu = () =>{
    return(
        <>
        <div className="header">
        <div className="box_center">
        <ol>
            <li><NavLink activeClassName="Linkhover" to='/'>Main page </NavLink></li>
            <li><NavLink to='/1'>Comment Box  </NavLink></li>
            <li><NavLink to='/2'>Note Box </NavLink></li>
          </ol>
        </div>
        </div>
        </>
    );
};
export default Menu;
